    [],nt"revision_timestamp": "2016-04-06T23:21:00.600515",nt"name": "health-outcomes-survey-limited-data-set",nt"isopen":
    true,nt"url": null,nt"notes": "<p>The Medicare Health Outcomes Survey (HOS)
    limited data sets (LDS) are comprised of the entire national sample for a given
    2-year cohort (including both respondents and non-respondents), and contain all
    of the HOS survey items. The HOS LDS files include Medicare health plan identifiers,
    as well as several additional variables describing plan characteristics. They also
    contain protected beneficiary-level health information such as date of birth, however,
    specific direct person identifiers (i.e. name and health insurance claim number)
    are not included in the LDS files.</p>n",nt"license_title": "Other License
